exports.Productos = async (req, res, next) => {
    try {
        // Obtener el parámetro desde la URL
        const tipoProducto = req.body.tipoProducto;
 console.log(req) ;
        // Realizar alguna lógica de negocio o manipulación de datos si es necesario
        let respuesta = '';

        switch (tipoProducto) {
            case 'Paquetes':
                respuesta = {'A.' : "Cobro en el banco",
                'B.' : "No cobro en el banco",
                'C.' : "Soy monotributista",
                'D.' : "Soy responsable inscripto/a"
                                 };
                break;
            case 'Tarjetas':
                respuesta = 'Endpoint para Tarjetas';
                break;
            case 'CuentaDni':
                respuesta = 'Endpoint para Cuenta DNI';
                break;
            default:
                respuesta = 'Tipo de producto no válido';
        }

        // Enviar una respuesta JSON
        res.json({ mensaje: respuesta });
    } catch (error) {
        console.error('Error en el controlador:', error);
        res.status(500).json({ error: 'Error interno del servidor' });
    }
}

